import React from 'react';
import { useLocation } from 'react-router-dom';

export default function TodoPageContainer() {
  const location = useLocation();
  const { id } = location.state.todo;
  return (
    <>
      <h1>Todo page</h1>
      <div>{id}</div>
    </>
  );
}
